import { Message } from "semantic-ui-react";
import "semantic-ui-css"
class Clearing extends Component {
  render() {
    return (
      <div>
        <Message size='massive' style={{textAlign:"center"}}>
          <Message.Header>
            The payment was succesful
          </Message.Header>
          <p>A confirmation of payment will send you the existing word in the system</p>
        </Message>
      </div>

    )
  }
}

export default Clearing
